function maximumsSplicedArray(nums1, nums2) {
    function f(nums1, nums2) {
        let d = nums1.map((num1, i) => num1 - nums2[i]);
        let t = mx = d[0];
        for (let i = 1; i < d.length; i++) {
            let v = d[i];
            if (t > 0) {
                t += v;
            } else {
                t = v;
            }
            mx = Math.max(mx, t);
        }
        return mx;
    }
    let s1 = nums1.reduce((a, b) => a + b, 0);
    let s2 = nums2.reduce((a, b) => a + b, 0);
    return Math.max(s2 + f(nums1, nums2), s1 + f(nums2, nums1));
}
